import React from 'react';
import './contact.css';

function Contact (props) {
    console.log(props.data.personal_information.contact)
    const contact = props.data.personal_information.contact;

    const listContact = contact.map((item,i) => 
        <li key={i}> {item.direction} </li>
    )

    const listLanguages = Languages.map((Language, i) =>
        <li key={i}>  {Language.language}</li>
    );

    return (
        <div className="Contact">
            <span className="subtitle">CONTACTO</span>
            <hr></hr>
            <ul>
                {{listContact}}
            </ul>
        </div>
    )
}

export default Contact;
